import HomeCarousel from './Carousel/index';


const Home = () => {
    return (
        <section id="hero">
    <div id="heroCarousel" class="carousel slide carousel-fade" data-ride="carousel">

        <ol class="carousel-indicators" id="hero-carousel-indicators"></ol>

        <div class="carousel-inner" role="listbox">

            <div class="carousel-item active">
                <div class="container">
                    <h2>Добре дошли в <span>Lipita systems</span></h2>
                    <p>Ние сме малка фирма в IT сферата, занимаваща се с набор от услуги полезни и нужни за всеки бизнес.</p>
                    <a href="#services" class="btn-get-started scrollto">Какво предлагаме?</a>
                </div>
            </div>
        </div>

    </div>
</section>
    )
}

export default Home;
